    public DateTime startDate = DateTime.MinValue;
    public DateTime endDate = DateTime.MaxValue;
    public string supplier;
    public string invoice;
    public string PaymentDescription;
    public string reference;

    
    List<Account> accounts = new List<Account>();
    
    protected override async Task OnInitializedAsync()
    {
   
         var data = await http.GetFromJsonAsync<List<Account>>("https://localhost:44343/api/Account");
         if (data != null)
         {
              accounts = data;
         }
    }
    


    public List<Account> FunListinvoice()
    {
        if (endDate == Convert.ToDateTime("1/1/0001 0:00:00"))
        {
            endDate = DateTime.Now;
            accounts = accounts.Where(m => m.InvoiceSupplierDate >= startDate && m.InvoiceSupplierDate <= endDate).ToList();
        }
        else
        {
            accounts = accounts.Where(m => m.InvoiceSupplierDate >= startDate && m.InvoiceSupplierDate <= endDate).ToList();
        }

        if (supplier != null) { accounts = accounts.Where(t => (t.Supplier.Contains(supplier))).ToList(); }
        if (invoice != null) { accounts = accounts.Where(t => (t.No_Invoice.Contains(invoice))).ToList(); }
        if (reference != null) { accounts = accounts.Where(t => (t.Reference.Contains(reference))).ToList(); }
        if (reference != null) { accounts = accounts.Where(t => (t.PaymentDescription.Contains(PaymentDescription))).ToList(); }
        return accounts;
    }
    public void Search()
    {
        FunListinvoice();
    }

